import React, { Component } from 'react'

class Head extends Component {

    render() {
        const Head = {
            position: 'relative',
            backgroundColor: '#2dcf91',
            minWidth: '500px'
        };

        return (
            <div style = { Head }>
                Teste
            </div>
        )
    }
}

export default Head;
